import React, { Component } from "react";

export default class Talent extends Component {
  talentStyle = () => {
    if (this.props.selected) {
      console.log("Hello");
    }
  };

  render() {
    return (
      <td>
        <img
          src={this.props.talent.icon_url["64x64"]}
          styles={this.talentStyle()}
          height="50px"
        />
      </td>
    );
  }
}
